import React, { useState } from 'react';
import './DataTable.css';

const DataTable = () => {
  const [tableData, setTableData] = useState([
    { id: 1, date: '01/01/2023', description: 'Purchase groceries', amount: 100 },
    { id: 2, date: '02/01/2023', description: 'Pay rent', amount: 1000 },
    { id: 3, date: '03/01/2023', description: 'Buy gas', amount: 50 },
    { id: 4, date: '04/01/2023', description: 'Buy books', amount: 40 }
  ]);

  const data1 = [
    { id: 1, date: '01/01/2023', description: 'Purchase groceries', amount: 100 },
    { id: 2, date: '02/01/2023', description: 'Pay rent', amount: 1000 },
    { id: 3, date: '03/01/2023', description: 'Buy gas', amount: 50 },
    { id: 4, date: '04/01/2023', description: 'Buy books', amount: 40 }
  ];

  const data2 = [
    { id: 5, date: '05/01/2023', description: 'Buy clothes', amount: 60 },
    { id: 6, date: '06/01/2023', description: 'Buy shoes', amount: 70 },
    { id: 7, date: '07/01/2023', description: 'Buy a car', amount: 20000 },
    { id: 8, date: '08/01/2023', description: 'Buy a house', amount: 400000 }
  ];

  const handleTable1 = () => {
    setTableData(data1);
  };

  const handleTable2 = () => {
    setTableData(data2);
  };

  return (
    <div className="datatable">
      <div className="buttons">
        <button onClick={handleTable1}>Table 1</button>
        <button onClick={handleTable2}>Table 2</button>
      </div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Date</th>
            <th>Description</th>
            <th>Amount</th>
          </tr>
        </thead>
        <tbody>
          {tableData.map(row => (
            <tr key={row.id}>
              <td>{row.id}</td>
              <td>{row.date}</td>
              <td>{row.description}</td>
              <td>{row.amount}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DataTable;
